hat *daily study hours* have a *clear positive correlation with grades*, being the most influential factor. Interestingly, the findings also suggest that *higher stress levels are associated with better academic performance*. This indicates that while dedicated study habits contribute to academic success, the intensity of this effort or perhaps the pressure to achieve high grades may also be a significant factor contributing to increased student stress level.\n","\n","The results from the linear model further confirmed the significant impact of study hours on grades,\n","with a coefficient of 0.386, suggesting that for every additional hour of studying, a student's grade is predicted to increase by approximately 0.39 points.\n","\n","These findings suggest that schools and educators could benefit from promoting balanced study habits and robust stress management resources to improve student outcomes and well-being, ensuring that academic excellence does not come at the cost of mental health."]},{"cell_type":"markdown","id":"9a44af84","metadata":{"papermill":{"duration":0.061243,"end_time":"2025-08-06T16:00:27.02013","exception":false,"start_time":"2025-08-06T16:00:26.958887","status":"completed"},"tags":[]},"source":["Thank you!"]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":7103940,"sourceId":11352975,"sourceType":"datasetVersion"}],"dockerImageVersionId":30749,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.4.0"},"papermill":{"default_parameters":{},"duration":17.105591,"end_time":"2025-08-06T16:00:27.203721","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2025-08-06T16:00:10.09813","version":"2.6.0"}},"nbformat":